  selector: 'app-restore-password-page',
  templateUrl: './restore-password-page.component.html',
  styleUrls: ['./restore-password-page.component.css']
})
export class RestorePasswordPageComponent {
}
<div class="main-body">
  <app-header></app-header>
  <app-error></app-error>

  <app-narrow-area
